--
-- Create procedure `Proc_GetTaxsFilterPaging`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_GetTaxsFilterPaging (IN TaxFilter varchar(255), IN Year int, IN PageIndex int, IN PageSize int, OUT TotalRecord int, OUT TotalPage int)
BEGIN
  SET @TaxFilter = (SELECT
      TaxFilter);
  SET @Year = (SELECT
      Year);
  IF PageSize > 0 THEN
    SELECT
      t.TaxId,
      t.TaxCode,
      t.TaxName,
      t.StartDate,
      t.EndDate,
      t.Year,
      t.Quantity,
      t.SummaryTax,
      t.Description,
      t.CreatedDate,
      t.CreatedBy,
      t.ModifiedDate,
      t.ModifiedBy
    FROM view_tax t
    WHERE (
    @TaxFilter IS NULL
    OR @TaxFilter = ""
    OR (
    @TaxFilter IS NOT NULL
    AND (t.TaxCode LIKE CONCAT('%', @TaxFilter, '%')
    OR t.TaxName LIKE BINARY CONCAT('%', @TaxFilter, '%'))
    )
    )
    AND (@Year = t.Year
    OR @Year IS NULL
    OR @Year = 0)
    ORDER BY t.CreatedDate DESC
    LIMIT PageSize OFFSET PageIndex;

    SET TotalRecord = (SELECT
        COUNT(*)
      FROM Tax t
      WHERE (
      @TaxFilter IS NULL
      OR @TaxFilter = ""
      OR (
      @TaxFilter IS NOT NULL
      AND (t.TaxCode LIKE CONCAT('%', @TaxFilter, '%')
      OR t.TaxName LIKE BINARY CONCAT('%', @TaxFilter, '%'))
      )
      )
      AND (@Year = t.Year
      OR @Year IS NULL
      OR @Year = 0));
    SET TotalPage = CEILING(1.0 * TotalRecord / PageSize);
  END IF;
END
$$

--
-- Create function `Func_GetNewCodeNumber`
--
CREATE DEFINER = 'root'@'localhost'
FUNCTION Func_GetNewCodeNumber (MaxNumber int, Len int)
RETURNS varchar(50) CHARSET utf8
BEGIN
  DECLARE newCodeNumber varchar(50) DEFAULT '';
  SET newCodeNumber = CAST((MaxNumber + 1) AS char);

  WHILE LENGTH(newCodeNumber) < Len DO
    SET newCodeNumber = CONCAT('0', newCodeNumber);
  END WHILE;

  RETURN newCodeNumber;
END
$$

